const videos = [
    {
        name: 'Голова',
        duration: 10,
    },
    {
        name: 'Плечи',
        duration: 20,
    },
    {
        name: 'Руки',
        duration: 30,
    },
    {
        name: 'Тело',
        duration: 40,
    },
    {
        name: 'Ноги',
        duration: 50,
    },
]

export function VideoList() {
    return (
        <>
            <h1>Список Видео:</h1>
            {
                videos.map((video) => {
                    return (
                        <div>
                            <div>{video.name}</div>
                            <div>{video.duration}</div>
                            <button>Like!</button>
                        </div>
                    )
                })
            }
        </>
    )
}
